create table MOCK_DATA (
	pid INT,
	ssn INT,
	last_name VARCHAR(50),
	first_name VARCHAR(50),
	middle_name VARCHAR(50),
	phone_number INT,
	street_address VARCHAR(50),
	zip_code INT,
	dob DATE,
	start_date DATE,
	end_date DATE,
	station_id INT,
	salary VARCHAR(50),
	rank VARCHAR(10),
	vacation VARCHAR(50),
	employee_type VARCHAR(8),
	us_citizen VARCHAR(50),
	password VARCHAR(50),
	admin VARCHAR(50)
);
